import * as React from "react";
import { Room } from "../generated/graphql";
import { MDBCarousel, MDBCarouselInner, MDBCarouselItem, MDBView, MDBContainer } from "mdbreact";
type Props = {
    room: Room
};

const RoomCard: React.FunctionComponent<Props> = ({
    room
}) => {
    return (
        <MDBContainer>
            <MDBCarousel
                activeItem={1}
                length={3}
                showControls={true}
                showIndicators={true}
                className="z-depth-1"
            >
                <MDBCarouselInner>
                    <MDBCarouselItem itemId="1">
                        <MDBView>
                            <div className="w-full h-64 bg-cover bg-center rounded-lg mb-2 " style={{ backgroundImage: `url("https://i.picsum.photos/id/480/200/300.jpg")` }}></div>
                        </MDBView>
                    </MDBCarouselItem>
                    <MDBCarouselItem itemId="2">
                        <MDBView>
                            <div className="w-full h-64 bg-cover bg-center rounded-lg mb-2 " style={{ backgroundImage: `url("https://i.picsum.photos/id/700/200/300.jpg")` }}></div>
                        </MDBView>
                    </MDBCarouselItem>
                    <MDBCarouselItem itemId="3">
                        <MDBView>
                            <div className="w-full h-64 bg-cover bg-center rounded-lg mb-2 " style={{ backgroundImage: `url("https://i.picsum.photos/id/704/200/300.jpg")` }}></div>
                        </MDBView>
                    </MDBCarouselItem>
                </MDBCarouselInner>
            </MDBCarousel>
        </MDBContainer>
    );
}

export default RoomCard;
